create database ESMS_Db
use ESMS_Db

------------------------------ ESMS DATABASE ------------------------------
CREATE TABLE Majors (
    MajorID UNIQUEIDENTIFIER PRIMARY KEY,
    MajorName VARCHAR(255)
);

CREATE TABLE Courses (
    CourseID UNIQUEIDENTIFIER PRIMARY KEY,
    CourseName VARCHAR(255),
	MajorID UNIQUEIDENTIFIER,
    FOREIGN KEY (MajorID) REFERENCES Majors(MajorID)
);

CREATE TABLE Students (
    StudentID UNIQUEIDENTIFIER PRIMARY KEY,
    Username VARCHAR(255),
    PasswordHash NVARCHAR(255),
    Email VARCHAR(255),
	FullName VARCHAR(255),
	PhoneNumber VARCHAR(20),
    HomeAddress VARCHAR(255),
    DateOfBirth DATE,
    Gender VARCHAR(50),
    ProfilePicture NVARCHAR(255),
	MajorID UNIQUEIDENTIFIER,
    FOREIGN KEY (MajorID) REFERENCES Majors(MajorID)
);

CREATE TABLE CourseEnrollments (
    PRIMARY KEY (StudentID, CourseID), -- Composite key
    StudentID UNIQUEIDENTIFIER,
    CourseID UNIQUEIDENTIFIER,
    FOREIGN KEY (StudentID) REFERENCES Students(StudentID),
    FOREIGN KEY (CourseID) REFERENCES Courses(CourseID)
);

CREATE TABLE Staff (
    StaffID UNIQUEIDENTIFIER PRIMARY KEY,
    Username VARCHAR(255),
    PasswordHash NVARCHAR(255),
	Email VARCHAR(255),
	FullName VARCHAR(255),
	PhoneNumber VARCHAR(20),
    HomeAddress VARCHAR(255),
    DateOfBirth DATE,
    Gender VARCHAR(50),
    ProfilePicture NVARCHAR(255),
	StaffRole VARCHAR(50)
);

CREATE TABLE Teachers (
    TeacherID UNIQUEIDENTIFIER PRIMARY KEY,
    Username VARCHAR(255),
    PasswordHash NVARCHAR(255),
    Email VARCHAR(255),
	FullName VARCHAR(255),
	PhoneNumber VARCHAR(20),
    HomeAddress VARCHAR(255),
    DateOfBirth DATE,
    Gender VARCHAR(50),
    ProfilePicture NVARCHAR(255),
	MajorID UNIQUEIDENTIFIER,
    FOREIGN KEY (MajorID) REFERENCES Majors(MajorID)
);

CREATE TABLE ExamRooms (
    RoomID UNIQUEIDENTIFIER PRIMARY KEY,
    RoomName VARCHAR(255)
);

CREATE TABLE ExamShifts (
    ShiftID UNIQUEIDENTIFIER PRIMARY KEY,
    ShiftName VARCHAR(255),
	StartTime TIME,
    EndTime TIME
);

-- capacity update real time and a field to know if the exam has passed
CREATE TABLE ExamSessions (
    ExamSessionID UNIQUEIDENTIFIER PRIMARY KEY,
    CourseID UNIQUEIDENTIFIER, -- Foreign key reference to Courses
	ExamDate DATE,
	RoomID UNIQUEIDENTIFIER, -- Foreign key reference to ExamRooms
	TeacherID UNIQUEIDENTIFIER, -- Foreign key reference to Teachers
	StudentsEnrolled INT,
    StaffID UNIQUEIDENTIFIER, -- Foreign key reference to Staff (Testing Admin)
    ShiftID UNIQUEIDENTIFIER, -- Foreign key reference to ExamShifts
	IsPassed BIT,
	IsPaid BIT,
    FOREIGN KEY (CourseID) REFERENCES Courses(CourseID),
    FOREIGN KEY (RoomID) REFERENCES ExamRooms(RoomID),
    FOREIGN KEY (TeacherID) REFERENCES Teachers(TeacherID),
    FOREIGN KEY (StaffID) REFERENCES Staff(StaffID), 
    FOREIGN KEY (ShiftID) REFERENCES ExamShifts(ShiftID) 
);

CREATE TABLE ExamEnrollments (
    PRIMARY KEY (ExamSessionID, StudentID), -- Composite key
    ExamSessionID UNIQUEIDENTIFIER,
    StudentID UNIQUEIDENTIFIER,
    FOREIGN KEY (ExamSessionID) REFERENCES ExamSessions(ExamSessionID),
    FOREIGN KEY (StudentID) REFERENCES Students(StudentID)
);

CREATE TABLE ConfigurationSettings (
	SettingID UNIQUEIDENTIFIER PRIMARY KEY,
    SettingName VARCHAR(255),
    SettingValue DECIMAL(10, 2),
    SettingDescription VARCHAR(255)
);




